export const COLUMNS = [
    {
        Header: 'Id',
        accessor: 'id'
    },
    {
        Header: 'Name',
        accessor: 'name'
    },
    {
        Header: 'Description',
        accessor: 'description',
        disableSortBy: true
    },
    {
        Header: 'Initial price',
        accessor: 'initial_price',
        disableFilters: true
    },
    {
        Header: 'Actual bind',
        accessor: 'last_bind'
    },
    {
        Header: 'User',
        accessor: 'last_bind_user'
    }
]
